import React from 'react';
import { Button , Card , message , Row , Col } from 'antd';
import axios from 'axios';

class Page extends React.Component{
	handleClick = () => {
		//axios.get("server port").then(response =>{
		//	console.log(response)
		//})
		//.catch(error => {
		//  console.log(error)	
		//})
		message.success("Button Clicked")
	}
	render(){
		return(<div>
				<Row>
					<Col span={12}>
						<Card className="container">
							<Button type="primary" className="click-btn" onClick={this.handleClick}>Click here</Button>
						</Card>
					</Col>
					<Col span={12}>
						<Card className="sound-box">
							<audio controls>
	  							<source src="horse.mp3" type="audio/mpeg" />
							</audio>
						</Card>
					</Col>
				</Row>


			</div>
		)
	}
}
export default Page;
